• Посетил 62 субъекта России 🇷🇺 и 57 стран 🌎;
• Написал и издал книгу о личном опыте путешествия длиною в год 📚;
• Состою в Русском географическом обществе 🌐;
• Считаю работу в сфере туризма своим призванием 🧭;
• Увлекаюсь путешествиями и спортом 🏆;
• Мечтаю исследовать все страны мира и стать космическим туристом 🚀

В компании OhMyRussia! мы организуем путешествия в сфере внутреннего и международного въездного туризма, другими словами - мы открываем, исследуем, чувствуем Россию с нашими соотечественниками и иностранными путешественниками. У нас маршруты с уникальными природными локациями, в которых мы можем: 
🌋 увидеть чудеса России: от Долины гейзеров на Камчатке до вершины Эльбруса 🏔;
🐳 проникнуться энергией дикой природы, наблюдая за китами; 
🌌 восхититься северным сиянием в Арктике или бескрайним озером Байкал; 
🌊 почувствовать мощь водопадов плато Путорана; 
🥗 насладиться вкусами кавказской кухни или традиционными блюдами северных народов; 
💐 уловить ароматы горных цветов Алтая или запах океана; 
🧭 погостить у кочевников в тундре; 
☀ встретить рассвет на краю земли; 
🚀 попасть на старт космического корабля и многое другое! 

Открывай! Исследуй! Чувствуй!
